import { Link } from "react-router-dom";
import React from "react";
import { useUserEmail } from "../contexts/context";

export const Dashboard = () => {
    const { userEmail } = useUserEmail();

    return (
        <div className="bg-gray-100 min-h-screen flex flex-col justify-center items-center">


            <div className="flex items-center">
                <Link to="/liststatus">
                    <div className="w-fit rounded-[25px] bg-white p-8 aspect mr-8">
                        <div className="my-2">
                            <h2 className="text-4xl font-bold"><span>View application status</span></h2>
                        </div>
                    </div>
                </Link>
                <Link to="/STUDENT_MASTER">
                    <div className="w-fit rounded-[25px] bg-white p-8 aspect mr-8">
                        <div className="my-2">
                            <h2 className="text-4xl font-bold"><span>Fill application</span></h2>
                        </div>
                    </div>
                </Link>
                <Link to="/register">
                    <div className="w-fit rounded-[25px] bg-white p-8 aspect mr-8">
                        <div className="my-2">
                            <h2 className="text-4xl font-bold"><span>Download blank form</span></h2>
                        </div>
                    </div>
                </Link>
            </div>
        </div>
    );
};

export default Dashboard;
